import React from 'react'

const Submeta = () => {
  return (
    <div className='container'>
      <p className='display-6 mt-4'><strong>Submeta seu trabalho</strong></p>
      <p>A submissão de trabalhos está aberta para alunos da <strong>graduação</strong> e <strong>pós-graduação</strong> nas modalidades <strong>Pesquisa</strong> e <strong>Ensino/Extensão</strong></p>
      <p>Mas <strong>atenção!</strong>Para submeter seu trabalho, você deve estar inscrito como ouvinte, se ainda não se inscreveu <a href="/inscrições">clique aqui</a> para se inscrever.</p>
      <hr className='mt-4'/>
    </div>
  )
}

export default Submeta
